Job Summary
The Machine Learning (ML) Data Engineer will primarily focus on data collection, labeling, cleaning, and annotating for machine learning projects. Work closely with the Automation Specialist and Automation Team to ensure high-quality and properly labeled datasets for training and model development. Build, deploy, and maintain the data infrastructure, such as the data pipeline, responsible for transferring the data from the different sources to Automation Server.
Duties and Responsibilities:
Clear Data Requirements: Work closely with the Automation Specialist and Automation Team to clearly define the data requirements for training and model development. Understand the specific attributes, formats, and labeling guidelines needed for the machine learning models;
Data Source Evaluation: Evaluate the different data sources available and determine their suitability for the project. Consider factors such as data quality, relevance, diversity, and legality. Collaborate with relevant stakeholders to acquire and access the necessary data sources; 
Data Collection Strategy: Develop a comprehensive strategy for data collection that aligns with the project’s goals. This includes identifying relevant data sources, determining the data collection methods (e.g., web scraping, APIs, manual collection), and establishing protocols for data storage and security;
Data Cleaning and Preprocessing: Implement robust data cleaning and preprocessing techniques to ensure the data is accurate, consistent, and suitable for machine learning algorithms. This may involve handling missing values, removing duplicates, standardizing formats, and addressing outliers or noise;
Labeling and Annotation: Establish clear guidelines and standards for data labeling and annotation. Collaborate with domain experts to accurately labe; and annotate the data, ensuring consistency and quality. Leverage automated tools or crowdsourcing platforms when feasible to scale labeling process;
Quality Assurance: Implement a rigorous quality assurance process to validate the labeled and annotated datasets. Develop a feedback loop with Automation Specialist and Automation Team to address any issues, discrepancies, or ambiguities in the data labeling. Regularly monitor and audit the data to ensure ongoing quality;
Data Pipeline Development: Build, deploy, and maintain a robust data pipeline that facilitates the transfer of data from different sources to the Automation Server. This includes designing an efficient workflow, integrating data collection tools and methods, and ensuring data integrity and security throughout the pipeline;
Data Governance and Compliance:  Ensure compliance with relevant data governance policies, regulations, and privacy requirements. Implement appropriate measures to protect sensitive or personally identifiable information in the data. Establish data access controls and monitor data usage to maintain compliance;
Documentation and Version Control: Maintain comprehensive documentation of the data collection, labeling, cleaning and annotation processes. Use version control systems to track changes and revisions in the datasets and associated metadata. This documentation and version control will aid in reproducibility and future enhancements;
Collaboration and Communication: Foster strong collaboration and communication between the data team, Automation specialist, and Automation Team. Regularly update on progress, challenges, and requirements. Provide timely feedback and support to ensure high-quality datasets and efficient model development.
Key Qualifications:
BS Information technology or Equivalent;
Strong understanding of Machine Learning concepts and methodologies;
Proficiency in programming languages;
Python, R or Java
Experience with data collection, cleaning, labeling, and annotation techniques;
Ability to work in a team or alone;
Self-starter with a passion for IoT Technology

