An AutoCAD Operator is an individual that uses computer-aided design (CAD) software for electronic drafting of custom blueprints. Your responsibilities in this career are to utilize the software to create technical drawings and designs that can be used to create projects in various industries.
Duties and Responsibilities:
Understands the equations, calculations, and written instructions from designers and engineers before beginning a CAD drawing;
Uses special notations and symbols to give instructions on drawings and blueprints;
Revises drawings based in instructions from engineers;
Reviews engineering data to ensure compliance with original design plans;
Other task that may be assigned from time to time.
Knowledge, Skills and Qualifications:
Bachelors College degree in Architecture, Engineering or any equivalent courses;
Excellent written and oral communications skills;
Must be mechanically inclined;
Knowledgeable in 2D and 3D autocad;
Must be detail oriented
